import { GreenHouseCam } from "./GreenHouseCam/GreenHouseCam";
import { GreenHouseOption } from "./GreenHouseOption/GreenHouseOption";

export const GreenHouse = () => {
    return (
        <div className="greenhouse">
            <GreenHouseCam/>
            <GreenHouseOption/>
        </div>
    )
}

export default GreenHouse;
